const newURL = 'newURL'

let initialState = {
    MainNumberURL:''
}

export const showReducer = (state=initialState, action) =>{
    switch (action.type) {
        case newURL:
            return{
                ...state,
                MainNumberURL: action.changeUrl
            }
        default: return state;
    }
}
export const changeUrl = (changUrl) => {
    return{
        type: newURL,
        changeUrl
    }
}
